auctionbatch.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

contract Auction {
    string public item;
    uint public endTime;

    constructor(string memory _item) {
        item = _item;
        endTime = block.timestamp + 3 days;
    }
}

contract BatchDeployAuction {
    Auction[] public auctions;

    function deployAll() public {
        require(auctions.length == 0, "Already deployed");
        for (uint i = 1; i <= 30; i++) {
            string memory itemName = string(abi.encodePacked("Item_", uint2str(i)));
            Auction a = new Auction(itemName);
            auctions.push(a);
        }
    }

    function get(uint index) public view returns (address) {
        return address(auctions[index]);
    }

    function uint2str(uint _i) internal pure returns (string memory str) {
        if (_i == 0) return "0";
        uint j = _i; uint len;
        while (j != 0) { len++; j /= 10; }
        bytes memory bstr = new bytes(len);
        uint k = len;
        while (_i != 0) { k--; bstr[k] = bytes1(uint8(48 + _i % 10)); _i /= 10; }
        str = string(bstr);
    }
}

